import { BrowserRouter, Routes, Route } from "react-router-dom";
import AppContainer from "./components/AppContainer"

import "./App.scss";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route index element={<AppContainer />} />
        </Routes>
      </BrowserRouter>
    </div >
  );
}

export default App;
